var taskPage={initialize:function(n,t){taskPage.attachEvents(n,t)},attachEvents:function(n,t){taskPage.createMyFilterCheckbox();taskPage.createDatatable();taskPage.myFilterDatatable(t);taskPage.redirectTaskDetails(n)},createMyFilterCheckbox:function(){$(".i-checks").iCheck({checkboxClass:"icheckbox_square-green",radioClass:"iradio_square-green"})},createDatatable:function(){var n=$("#taskListTableId").DataTable({columnDefs:[{orderable:!1,targets:0},{targets:[0],visible:!1,searchable:!1},{render:function(n,t,i){return n+" ("+i[3]+")"},targets:0},]})},myFilterDatatable:function(n){var t=$("#taskListTableId").DataTable();$(".iCheck-helper").on("click",function(){$(".iCheck-helper").parent().attr("class").indexOf("checked")>-1?t.columns(6).search(n).draw():t.columns(6).search("").draw()})},redirectTaskDetails:function(n){$("#taskListTableId tbody").on("click","tr",function(){$("#processing-modal").modal("show");var i=$("#taskListTableId").DataTable(),t=i.row(this).data();window.location.href=n+"?taskId="+Base64.encode(t[0])+"&taskName="+Base64.encode(t[2])})}};